import React, {useState} from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import Navigation from './components/Navigation';
import LoggedRouter from "./components/LoggedRouter";
import UnLoggedRouter from "./components/UnLoggedRouter";
import axios from 'axios';

// Setting baseURL
axios.defaults.baseURL = 'http://localhost:8080';

const App = () => {

    const accessToken = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJzdWIiOiI2NDg4NjA5MDViZjM5ODM0Yzg2NzM0NDQiLCJpYXQiOjE2ODY2NTkyNDR9.ZB2BwanzdEPwfPPDbdVDJRiHc5jb2XzoMxiLT7xbkoo";

  const [logged, setLogged] = useState(true)
  return (
      <div>
        <Router >
          <Navigation accessToken={accessToken}/>
            {logged && <LoggedRouter accessToken={accessToken}/>}
            {!logged && <UnLoggedRouter/>}
        </Router>
      </div>
  );
};

export default App;
